import React, { Component } from 'react';
import {Route,Switch} from 'react-router-dom';
import axios from 'axios';
import {Table,Card,Button,Col,Row,Container} from 'react-bootstrap'


class App extends Component {
    constructor() {
        super()
        this.state = {
            mysore: 0,
            ghaziabad: 0,
            banglore: 0,
            jammu: 0,
            srinagar: 0,

            srinagarPatients:[],
            mysorePatients:[],
            ghaziabadPatients:[],
            banglorePatients:[],
            jammuPatients:[],

            currPatients:[],
            currCity:"",

            clicked:false
        }
    }

    async componentDidMount() {
        await axios.get("https://api.covid19india.org/state_district_wise.json").then(response=>{
            console.log(response.data);
            this.setState({
                mysore :response.data["Karnataka"].districtData.Mysuru.confirmed,
                jammu : response.data["Jammu and Kashmir"].districtData.Jammu.confirmed,
                srinagar: response.data["Jammu and Kashmir"].districtData.Srinagar.confirmed,
                ghaziabad: response.data["Uttar Pradesh"].districtData.Ghaziabad.confirmed,
                banglore: response.data["Karnataka"].districtData.Bengaluru.confirmed,
               },()=>{
                console.log(this.state)
            })
        }).catch(error => {
            console.log(error)
        });
       await axios.get("https://api.covid19india.org/raw_data.json").then(response=>{
            //console.log(response.data.raw_data);
            var srinagarPatients = [];
            var mysorePatients = [];
            var ghaziabadPatients = [];
            var banglorePatients = [];
            var jammuPatients = [];
            for(var i=0;i<response.data.raw_data.length;i++){
               // console.log(response.data.raw_data[i].detecteddistrict)
                if(response.data.raw_data[i].detecteddistrict === "Srinagar"){
                    srinagarPatients.push(response.data.raw_data[i])
                }else if(response.data.raw_data[i].detecteddistrict === "Mysuru"){
                    mysorePatients.push(response.data.raw_data[i])
                }else if(response.data.raw_data[i].detecteddistrict === "Ghaziabad"){
                    ghaziabadPatients.push(response.data.raw_data[i])
                }else if(response.data.raw_data[i].detecteddistrict === "Bengaluru"){
                    banglorePatients.push(response.data.raw_data[i])
                }else if(response.data.raw_data[i].detecteddistrict === "Jammu"){
                    jammuPatients.push(response.data.raw_data[i])
                }
            }

            this.setState({
                srinagarPatients : srinagarPatients,
                mysorePatients : mysorePatients,
                ghaziabadPatients : ghaziabadPatients,
                banglorePatients : banglorePatients,
                jammuPatients:jammuPatients
            },()=>{
                console.log(this.state)
            })
        }).catch(error => {
            console.log(error)
        });
    }

    clickHandler = (e)=>{
        console.log(e)
        var currPatients
        if(e === "Ghaziabad"){
            currPatients = [...this.state.ghaziabadPatients]
        }else if(e === "Mysore"){
            currPatients = [...this.state.mysorePatients]
        }else if(e === "Banglore"){
            currPatients = [...this.state.banglorePatients]
        }else if(e === "Srinagar"){
            currPatients = [...this.state.srinagarPatients]
        }else if(e === "Jammu"){
            currPatients = [...this.state.jammuPatients]
        }
        var val = this.state.clicked
        this.setState({clicked:!val,currPatients:currPatients,currCity:e},()=>{
            console.log(this.state)
        })

    }

    render(){
        var currPatientComponent;
        var currPatientTable;
        var generalComp;

        if(this.state.clicked === false){
             generalComp = (
                <div>
                    <Row>
                        <Col>

                        </Col>
                        <Col>
                            <br/>
                            <h1>Covid-19 District Wise split</h1>
                        </Col>
                        <Col>

                        </Col>
                    </Row>
                    <br/>
                    <br/>
                    <Container>
                        <Row>
                            <Col>
                                <Card style={{ width: '18rem' }}>
                                    <Card.Img variant="top" src="data:image/jpeg;base64," />
                                    <Card.Body>
                                        <Card.Title>Mysore</Card.Title>
                                        <Card.Text>
                                            Total Number of infected patients := {this.state.mysore}
                                        </Card.Text>
                                        <Button onClick = {()=>this.clickHandler("Mysore")} variant="primary">View Details</Button>
                                    </Card.Body>
                                </Card>
                            </Col>

                            <Col>
                                <Card style={{ width: '18rem' }}>
                                    <Card.Img variant="top" src="data:image/jpeg;base64," />
                                    <Card.Body>
                                        <Card.Title>Jammu</Card.Title>
                                        <Card.Text>
                                            Total Number of infected patients := {this.state.jammu}
                                        </Card.Text>
                                        <Button onClick = {()=>this.clickHandler("Jammu")} variant="primary">View Details</Button>
                                    </Card.Body>
                                </Card>
                            </Col>

                            <Col>
                                <Card style={{ width: '18rem' }}>
                                    <Card.Img variant="top" src="data:image/jpeg;base64," />
                                    <Card.Body>
                                        <Card.Title>Srinagar</Card.Title>
                                        <Card.Text>
                                            Total Number of infected patients := {this.state.srinagar}
                                        </Card.Text>
                                        <Button onClick = {()=>this.clickHandler("Srinagar")} variant="primary">View Details</Button>
                                    </Card.Body>
                                </Card>
                            </Col>
                        </Row>
                        <br/>
                        <br/>
                        <Row>
                            <Col>
                                <Card style={{ width: '18rem' }}>
                                    <Card.Img variant="top" src="data:image/jpeg;base64," />
                                    <Card.Body>
                                        <Card.Title>Banglore</Card.Title>
                                        <Card.Text>
                                            Total Number of infected patients := {this.state.banglore}
                                        </Card.Text>
                                        <Button onClick = {()=>this.clickHandler("Banglore")} variant="primary">View Details</Button>
                                    </Card.Body>
                                </Card>
                            </Col>

                            <Col>
                                <Card style={{ width: '18rem' }}>
                                    <Card.Img variant="top" src="data:image/jpeg;base64," />
                                    <Card.Body>
                                        <Card.Title>Ghaziabad</Card.Title>
                                        <Card.Text>
                                            Total Number of infected patients := {this.state.ghaziabad}
                                        </Card.Text>
                                        <Button onClick = {()=>this.clickHandler("Ghaziabad")} variant="primary">View Details</Button>
                                    </Card.Body>
                                </Card>
                            </Col>

                            <Col>

                            </Col>
                        </Row>
                    </Container>

                </div>
            )
            currPatientComponent = (
                <div>

                </div>
            )
            currPatientComponent =(
                <div>

                </div>
            )
        }else{
            generalComp =(
                <div>
                    <h1 onClick = {()=>this.clickHandler(this.state.currCity)}>{this.state.currCity}</h1>
                </div>
            )
            currPatientComponent=(
                this.state.currPatients.map(patient =>(
                    <tr>
                        <td>P{patient.patientnumber}</td>
                        <td>{patient.agebracket}</td>
                        <td>{patient.gender}</td>
                        <td>{patient.notes}</td>
                        <td>{patient.backupnotes}</td>
                    </tr>
                ))
            );
            currPatientTable = (
                <Table striped bordered hover>
                    <thead>
                    <tr>
                        <th>Patient Number</th>
                        <th>Age</th>
                        <th>Gender</th>
                        <th>Notes</th>
                        <th>Extra Notes</th>
                    </tr>
                    </thead>
                    <tbody>
                    {currPatientComponent}
                    </tbody>
                </Table>
            )
        }

        return (
            <div className="App">
                {generalComp}
                {currPatientTable}
            </div>
        );
    }
}

export default App;


